  \"2016-04-06T23:21:27.632224\",\n\t\"name\": \"cdc-wonder-daily-air-temperatures-and-heat-index\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Daily Air Temperature and Heat Index
  data available on CDC WONDER are county-level daily average air temperatures and
  heat index measures spanning the years 1979-2010. Temperature data are available
  in Fahrenheit or Celsius scales. Reported measures are the average temperature,
  number of observations, and range for the daily maximum and minimum air temperatures,
  and also percent coverage for the daily maximum heat index. Data are available by
  place (combined 48 contiguous states, region, division, state, county), time (year,
  month, day) and specified maximum and minimum air temperature, and heat index value.
  The data are derived from the North America Land Data Assimilation System (NLDAS)
  through NLDAS Phase 2, a collaboration project among several groups: the National
  Oceanic and Atmospheric Administration (NOAA) National Centers for Environmental
  Prediction (NCEP) Environmental Modeling Center (EMC), the National Aeronautics
  and Space Administration (NASA) Goddard Space Flight Center (GSFC), Princeton University,
  the National Weather Service (NWS) Office of Hydrological Development (OHD), the
  University of Washington, and the NCEP Climate Prediction Center (CPC). In a study
  funded by the NASA Applied Sciences Program/Public Health Program, scientists at
  NASA Marshall Space Flight Center/ Universities Space Research Association developed
  the analysis to produce the data available on CDC WONDER.</p>n\",\n\t\"license_title\":
